import './App.css';
import React from 'react';
import ApplicationBar from "./menu/ApplicationBar";
import {Typography} from "@material-ui/core";

function App() {
    return (
        <div>
            <ApplicationBar/>
            <div id="main">
                <div id="box1"></div>
                <div id="box2">
                    <div id="text">
                        <Typography variant="h1" noWrap>Hello,<br/>I'm Latifa</Typography>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default App;


